import React, { useState } from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import Navbar from './Components/Navbar';
import PageWave from './Page/pageWave/pageWave';
import Home from './Page/homePage/Home';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

const App = () => {


  return (
    <BrowserRouter>
          <button onClick={toggleContrastMode}>
        {highContrastMode ? 'Desactivar Contraste Alto' : 'Activar Contraste Alto'}
      </button>
      <Navbar />
      <div className={highContrastMode ? 'high-contrast' : ''}>
        <Route path="/" exact component={Home} />
        <Route path="/pageWave/:cardsProp/:booksProp" component={PageWave} />
      </div>

    </BrowserRouter>
  );
}

export default App;
